import React from 'react';
import { Container } from 'react-bootstrap';

const Contact = () => {
  return (
    <Container fluid className='app-content'>
      <h2>Contact</h2>
      <p>
        You can reach out to me at <a href='mailto:Stevemartin677@gmail.com'>Stevemartin677@gmail.com</a>.
      </p>
    </Container>
  );
};

export default Contact;
